import {FETCH_MEMS_SUCCESS, UPDATE_MEM} from "../actions/actionsType";

 const mems = (state = [], action) => {
  switch (action.type) {
    case FETCH_MEMS_SUCCESS:
      return [...action.mems];
      case UPDATE_MEM:
      return [...action.mem];
    default:
      return state;
  }
};

export default mems;
